import Card from './Card'

export default function Testimonials() {
    return (
        <div className='flex p-6 mt-32 w-full justify-center gap-x-20'>
        <div className='flex flex-col'>
        <Card  color={"yellow"}/>
        </div>
        <Card  color={"red"}/>
        <Card  color={"indigo"} />
     </div>
    )
}
